import React from "react";
import Hero from "../../components/Hero/Hero";
import ScriptTag from "react-script-tag";

const Home = () => {
  return (
    <div className="blur">
      <Hero />
      <ScriptTag
        isHydrating={true}
        type="text/javascript"
        src=""
      />
    </div>
  );
};

export default Home;
